La nomenclatura binomiale o nomenclatura binomia è una convenzione standard utilizzata in nomenclatura per conferire il nome a una specie. Come suggerisce lʼaggettivo binomio, il nome scientifico di una specie viene formato combinando due nomi: 
* il nome del genere a cui appartiene la specie; 
* un epiteto che caratterizzi e distingua quella specie dalle altre appartenenti allo stesso genere. Il primo termine (nome generico) porta sempre l'iniziale maiuscola, mentre il secondo termine (epiteto specifico) viene scritto in minuscolo; entrambi i nomi vanno inoltre scritti in corsivo (per es. Homo sapiens). Quando il genere è stato precedentemente trattato nel testo, o quando sono già state elencate delle specie di quel genere, il nome generico può essere abbreviato con la sua lettera iniziale (H. sapiens) ma non deve mai essere omesso. Solo di rado questa abbreviazione è comunemente usata in luogo del nome completo: per esempio, il nome del batterio Escherichia coli è spesso scritto nella forma E. coli.
